import React, { useEffect } from "react";
import AdminNavbar from "./DashboardComponents/AdminDashNav";
import AdminSidebar from "./DashboardComponents/Adminsidebar";
import AdminDashboardCards from "./DashboardComponents/Dasboardcards";
import "./index.css";
import { useDispatch, useSelector } from "react-redux";
import { dashboardActions } from "../../../../Actions";
import { FormatAmount } from "../../../../config";
import ReactApexChart from "react-apexcharts";
import RightBtn from "../../../../assets/Right Button.png";
import LeftBtn from "../../../../assets/Left Button.png";
import { useState } from "react";

const AdminDashboard = () => {
  const [state, setState] = useState<any>({
    series: [
      {
        name: "Market Overview",
        data: [],
      },
    ],
    options: {
      chart: {
        id: "Market Overview",
        zoom: {
          enabled: false,
        },
      },
      dataLabels: {
        enabled: false,
      },
      xaxis: {
        categories: [],
      },
      title: {
        text: "Market Overview",
      },
      grid: {
        row: {
          colors: ["#f3f3f3", "transparent"], // takes an array which will be repeated on columns
          opacity: 0.5,
        },
      },
    },
    //second graph
    series1: [
      {
        name: "High Revenue Items",
        data: [],
      },
    ],
    options1: {
      chart: {
        id: "High Revenue Items",
        zoom: {
          enabled: false,
        },
      },
      dataLabels: {
        enabled: false,
      },
      xaxis: {
        categories: [],
      },
      title: {
        text: "High Revenue Items",
      },
      grid: {
        row: {
          colors: ["#f3f3f3", "transparent"], // takes an array which will be repeated on columns
          opacity: 0.5,
        },
      },
    },
  });
  const getAnalytics = useSelector(
    (state: any) => state?.dashboardStats?.analytics
  );
  const dispatch = useDispatch();
  useEffect(() => {
    const GetAnalytics = async () => {
      await dispatch(dashboardActions.getAnalytics(`/admin/get-analytics`));
    };
    GetAnalytics();
  }, []);
  //console.log(getAnalytics);
  useEffect(() => {
    setState({
      ...state,
      series: [
        {
          name: "Revenue",
          data: getAnalytics?.high_revenue_items?.map((data) => {
            return data.revenue;
          }),
        },
      ],
      options: {
        chart: {
          id: "Market Overview",
          zoom: {
            enabled: false,
          },
        },
        dataLabels: {
          enabled: false,
        },
        xaxis: {
          categories: getAnalytics?.high_revenue_items?.map((data) => {
            return data.name;
          }),
        },
        title: {
          text: "",
        },
        grid: {
          row: {
            colors: ["#f3f3f3", "transparent"], // takes an array which will be repeated on columns
            opacity: 0.5,
          },
        },
      },
    });
  }, [getAnalytics]);
  return (
    <>
      <div className='contaniner-fluid'>
        <div className='dashboard_main_area dashboard_000 dashboard_000223 pb-5 row'>
          <AdminDashboardCards Analytics={getAnalytics} />
          <div className='col-md-12 expand12 pr0'>
            <div className='row'>
              <div className='col-md-7 dashboard_card_container'>
                <div className='top_container'>
                  <h6 className='font-weight-bolder'> Today: 5, Aug 2018</h6>
                  <div>
                    <span>
                      <select name='' id='' className='select_custom mr-5'>
                        <option value=''>1 Jan - 1 Jun</option>
                      </select>
                    </span>
                    <span>
                      <img src={LeftBtn} className='mr-1' alt='' />{" "}
                      <img src={RightBtn} className='' alt='' />
                    </span>
                  </div>
                </div>
              </div>
              <div className='col-md-5 dashboard_card_container p-3'>
                <h6>Orders</h6>
                <br />
                Pending Orders: 20 <br />
                Reconcilled Orders: 80
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default AdminDashboard;
